import React from 'react';
import classes from '../Ecommerce/Ecommerce.module.css';
import image from '../../../assets/images/logo192.png';

class WeatherFinder extends React.Component {
    render() {
        return (
            <div className={classes.Main}>
                <h1>Weather Finder</h1>
                <div className={classes.Content}>
                    <img src={image} alt="pic"/>
                    <p>This app allows users to find the current weather data for any city in the world, via search bar. The city typed in by the user then displays on an image of the world, converting the latitude nad longitude of the city to pixels.</p>
                    <p>This app uses vanilla JavaScript and AJAX to render the weather data, map, and connect to the DarkSky.net API. The app also uses imported SkyCons animations to dsiplay the current weather of any city.</p>
                    <button>DEMO</button>
                    <button>LIVE VERSION</button>
                    <button>VIEW CODE</button>
                </div>

            </div>
        );
    }
}

export default WeatherFinder;
